import {
  NavLink
} from 'react-router-dom';

import './styles.css';

const Navbar = () => (
  <nav className="nav">
    <NavLink
      to="/"
      className="nav-item"
      activeClassName="nav-item-active"
      exact
    >
      Accueil
    </NavLink>
    <NavLink>
      Connexion
    </NavLink>
  </nav>
);

export default Navbar;
